      cs: Zvolte základní nebo náhradní server, který je potřeba nastavit
      en: Select the primary or secondary server to setup.
      ge: აირჩიეთ ძირითადი ან დამატებითი სერვერი, რომელიც უნდა დაინსტალირდეს
      ru: Выберите основной или дополнительный сервер который надо установить
    cars.editor.SERVERTITLE:
      cs: 'Pokyn: Příkaz lze použít pouze pro zařízení Signal. Auto musí mít nastaveno správné telefonní číslo! Zvolte základní nebo náhradní server, který je potřeba nastavit. Po odeslání příkazu auto ještě potřebuje 5 až 20 pro připojení s upraveným nastavením. Neprovádějte dva příkazy za sebou pro jeden trecker. Pokud auto pracuje se dvěma servery současně, požaduje dvojí tok dat. Tlačítka vyhledání a spodní řádek v oddílu rychlého přepínání se použíjí pouze při převodu několika aut.'
      en: 'Manual: The command is applicable only for equipment Signal. The car must have a correct phone number! Select the primary or secondary server to setup. After sending the command, the machine needs from 5 to 20 minutes to apply the new settings. Do not execute 2 commands for one tracker immediately. If the tracker works with two servers, it consumes double traffic. Search buttons and substrings in quick transition section are used for several car transferring.'
      ge: >-
        ინსტრუქცია: ბრძანება გამოყენებადია მხოლოდ სიგნალის აღჭურვისთვის,
        მანქანას უნდა ქონდეს მინიჭებული ტელეფონის ნომერი. აირჩიეთ მთავარი ან დამატებითი სერვერი, რომელიც უნდა დაინსტალირდეს. ახალი კონფიგურაციით ხაზზე გამოსვლისთვის საჭიროა გაგზავნიდან 5-დან 20 წუთამდე. არ განახორციელოთ ორი ბრძანება ზედიზედ ერთი ტრეკერისთვის. თუ მანქანა მუშაობს ერთდროულად ორ სერვერზე, იგი მოიხმარს ორჯერ მეტ ინფორმაციას. ძებნის და შეცვლის ღილაკები სწრაფი რეაგირების პანელში გამოიყენება მხოლოდ რამოდენიმე მანქანის გადასატანად
      ru: 'Инструкция: Команда применима только для оборудования Сигнал. У машины должен быть установлен правильный номер телефона! Выберите основной или дополнительный сервер который надо установить. После отсылки команды машине надо от 5 до 20 минут чтобы выйти на связь с новыми настройками. Не выполняйте две команды подряд сразу для одного трекера. Если машина работает с двумя серверами она потребляет двойной трафик. Кнопки поиска и подстрока в разделе быстрого перехода применяются только для перевода нескольких машин.'
