      ru: Если при регистрации в нашем сервисе кто-то укажет ваш промо-код, он сразу же получит {{signupBonus}} бонусов на свой счёт, а вы получите {{bonusPercent}}% от суммы заказа на ваш счёт после его первой поездки, но не более {{maximumBonus}} бонусов. Число приглашаемых друзей не ограничено!
